import React from "react";
import Navbar2 from "./nav2";
import { Footer } from "./footer";

function OnlineProjects() {
  return (
    <div>
      <Navbar2 />
<div>
      <Table>
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Username</th>
          </tr>
        </thead>

      </Table>
</div>
      <Footer />
    </div>
  );
}

export default OnlineProjects;
